import React, {useState, useEffect} from 'react'
import '../../src/dist/css/output.css'
import MovieCard from './MovieCard';

export default function MovieGrid(props) {

  return (
    <div className=" min-h-screen flex bg-gray-400">
      <div className="dark:bg-gray-800 w-1/12 min-h-screen" >
      </div>
      <div className="p-2 w-10/12">
        <div className="grid sm:grid-cols-2 md:grid-cols-4 lg:grid-cols-5 gap-4">
        {props.data.map(props =>
        <MovieCard  data={props} />
        )}
        
          </div>
      </div>
      <div className="dark:bg-gray-800 w-1/12 min-h-screen" >
      </div>
    </div>
)}
